import logo from './logo.svg';
import './App.css';
import axios from 'axios'

function App() {
  axios.get(`https://localhost:3001/testdata`)
  .then(res => {
    console.log(res.data)
  })
  return (
    <div className="App">
      <header className="App-header">
       <p>Athelas Coding Test</p>
      </header>
    </div>
  );
}

export default App;
